(1, 1, 'Received: from pat.cs.nott.ac.uk by robin.Cs.Nott.AC.UK id ac08796;\n          21 Sep 2006 19:00 BST\nTo: ajp06u@Cs.Nott.AC.UK\nSubject: Welcome to CSiT at Nottingham\nFrom: Nick Reynolds <nir@Cs.Nott.AC.UK>\nDate: Thu, 21 Sep 2006 18:59:43 BST\nSender: root@Cs.Nott.AC.UK\nMessage-ID:  <200609211859.aa28057@pat.Cs.Nott.AC.UK>\n\nDear ajp06u,\n\nAs you are reading this email you will have collected your login details\nfor the school''s machines and successfully logged in. Contained in this\nmail are pointers to a few WWW addresses which it is suggested you take\na look at together with a little information about the Technical Services\nGroup (TSG).\n\n\nTechnical Services Group\n========================\n\nTSG provide support for the School''s technical equipment.\n\nPlease take a look at the TSG Web Pages which contain useful information\non using the machines in the school.\n\n   http://www.cs.nott.ac.uk/TSG/\n\nA good place to start is the "Overview of Services" page:\n\n   http://www.cs.nott.ac.uk/TSG/overview/\n\nIf you have any technical questions or require technical assistance,\nplease contact the user support office:\n\n   http://www.cs.nott.ac.uk/TSG/general_info/user_support.html\n\nOr use the CTS tracking system at:\n\n   http://www.cs.nott.ac.uk/TSG/CTS/\n\n\nRegards,\nNick Reynolds\n(Unix Systems Administrator)\n\n', 'Nj!oogfjA?`f!fhsjXop4J&yby?XW,L0xM:R>y"]sR@b<Pz+SC'),
(4, 1, 'Received: from pat.cs.nott.ac.uk by robin.Cs.Nott.AC.UK id aa00499;\n          29 Sep 2006 14:07 BST\nReceived: from localhost by pat.Cs.Nott.AC.UK id aa02418; 29 Sep 2006 14:07 BST\nReceived: from marian.cs.nott.ac.uk by pat.Cs.Nott.AC.UK id aa02051;\n	29 Sep 2006 14:06 BST\nReceived: from ackerman.cs.nott.ac.uk by marian.Cs.Nott.AC.UK id aa00265;\n	29 Sep 2006 14:06 BST\nMessage-ID: <451D19E8.10700@cs.nott.ac.uk>\nDate: Fri, 29 Sep 2006 14:04:40 +0100\nFrom: Dario Landa Silva <jds@Cs.Nott.AC.UK>\nUser-Agent: Mozilla Thunderbird 1.0.6 (Windows/20050716)\nX-Accept-Language: en-us, en\nMIME-Version: 1.0\nTo: tut-jds-1@Cs.Nott.AC.UK, tut-jds-3@Cs.Nott.AC.UK, tgs06u@Cs.Nott.AC.UK\nContent-Type: text/plain; charset=ISO-8859-1; format=flowed\nContent-Transfer-Encoding: 7bit\nCc:  \nSubject: [tut-jds-3] 1st G51TUT meeting\nX-BeenThere: tut-jds-3@cs.nott.ac.uk\nX-Mailman-Version: 2.1.5\nPrecedence: list\nList-Id: Tutor jds 3rd year tutees <tut-jds-3.cs.nott.ac.uk>\nList-Unsubscribe: <http://www.cs.nott.ac.uk/mailman/listinfo/tut-jds-3>,\n	<mailto:tut-jds-3-request@cs.nott.ac.uk?subject=unsubscribe>\nList-Archive: <http://www.cs.nott.ac.uk/mailman/private/tut-jds-3>\nList-Post: <mailto:tut-jds-3@cs.nott.ac.uk>\nList-Help: <mailto:tut-jds-3-request@cs.nott.ac.uk?subject=help>\nList-Subscribe: <http://www.cs.nott.ac.uk/mailman/listinfo/tut-jds-3>,\n	<mailto:tut-jds-3-request@cs.nott.ac.uk?subject=subscribe>\nSender: tut-jds-3-bounces@Cs.Nott.AC.UK\nErrors-To: tut-jds-3-bounces@cs.nott.ac.uk\n\nHello Everyone\n\nThanks to all those that came already to my office for the first brief \nmeeting on Wednesday. We will have our first ''formal'' meeting of this \nacademic year on Friday 6-Oct at 10am.\n\nThere is no way we all can fit in my office, so lets meet in the CSIT \natrium and lets hope that one of the big tables will be free, otherwise \nwe''ll see where we go.\n\nIn this meeting I want to discuss about your optional modules for this \nyear. If you can make a pre-selection in preparation for the meeting it \nwill be great. The full list of modules can be seen at:\n\nhttp://winster.nottingham.ac.uk/modulecatalogue/\n\nDario\n\n===================================================================\n                    Dario Landa Silva Ph.D.\n       ASAP Research Group, School of Computer Science and IT\n             Jubilee Campus, University of Nottingham\n                Wollaton Road, Nottingham, NG8 1BB\n   Email: jds @ cs.nott.ac.uk    Url: http:www.cs.nott.ac.uk/~jds\n   Tel: +44 (0)115 846 6522      Fax: +44 (0)115 846 7591\n====================================================================\n_______________________________________________\ntut-jds-3 mailing list\ntut-jds-3@cs.nott.ac.uk\nhttp://www.cs.nott.ac.uk/mailman/listinfo/tut-jds-3\n', 'D*PfZ`v43_%4NiI1v{_`SA!~tM5yK{h(D|LID+V&%d\\QoLWU2.'),
(5, 5, 'Received: from pat.cs.nott.ac.uk by robin.Cs.Nott.AC.UK id aa15771;\n          9 Oct 2006 17:53 BST\nReceived: from localhost by pat.Cs.Nott.AC.UK id aa29265; 9 Oct 2006 17:52 BST\nReceived: from quiver.cs.nott.ac.uk by pat.Cs.Nott.AC.UK id aa29165;\n	9 Oct 2006 17:52 BST\nDate: Mon, 9 Oct 2006 17:52:07 +0100 (BST)\nFrom: David Brailsford <dfb@Cs.Nott.AC.UK>\nTo: g51sci@Cs.Nott.AC.UK\nSubject: [G51SCI] Confirmation of announcements\nMessage-ID: <Pine.GSO.4.53.0610091749440.8239@quiver.cs.nott.ac.uk>\nMIME-Version: 1.0\nContent-Type: TEXT/PLAIN; charset=US-ASCII\nCc:  \nX-BeenThere: g51sci@cs.nott.ac.uk\nX-Mailman-Version: 2.1.5\nPrecedence: list\nList-Id: Module Skills for Communicating Information <g51sci.cs.nott.ac.uk>\nList-Unsubscribe: <http://www.cs.nott.ac.uk/mailman/listinfo/g51sci>,\n	<mailto:g51sci-request@cs.nott.ac.uk?subject=unsubscribe>\nList-Archive: <http://www.cs.nott.ac.uk/mailman/private/g51sci>\nList-Post: <mailto:g51sci@cs.nott.ac.uk>\nList-Help: <mailto:g51sci-request@cs.nott.ac.uk?subject=help>\nList-Subscribe: <http://www.cs.nott.ac.uk/mailman/listinfo/g51sci>,\n	<mailto:g51sci-request@cs.nott.ac.uk?subject=subscribe>\nSender: g51sci-bounces@Cs.Nott.AC.UK\nErrors-To: g51sci-bounces@cs.nott.ac.uk\n\n\nHi everyone,\n\nThis is just to confirm what I said in the lecture today. There will be NO\nG51SCI lecture this coming Friday (13th October) at 3.00 p.m.\n\nThe next lecture will be on Monday October 16th at 10.00 am and at that\nLecture I shall be handing out coursework 1 -- which is due to be handed\nin by Wednesday November 1st\n\nDFB\n\n\n------------------------------------------------------------------------------\nProfessor David F. Brailsford		  School of Computer Science\ne-mail: dfb@cs.nott.ac.uk			and Information Technology\nhttp://www.cs.nott.ac.uk/~dfb		  University of Nottingham\nTel: +44 (0)115 951 4207	 	  Jubilee Campus\nFax: +44 (0)115 951 4254                  NOTTINGHAM NG8 1BB,   UK.\n------------------------------------------------------------------------------\n_______________________________________________\ng51sci mailing list\ng51sci@cs.nott.ac.uk\nhttp://www.cs.nott.ac.uk/mailman/listinfo/g51sci\n', '}al9Is9S*Cp=^<.#Z]<|dJj}3)+Rn;W+U2E-RZiQ!UEW@6iO?>'),
