(9, 1, 'Received: from pat.cs.nott.ac.uk by robin.Cs.Nott.AC.UK id aa24652;\n          6 Nov 2006 16:50 GMT\nReceived: from localhost by pat.Cs.Nott.AC.UK id aa06157; 6 Nov 2006 16:49 GMT\nReceived: from marian.cs.nott.ac.uk by pat.Cs.Nott.AC.UK id aa18881;\n	6 Nov 2006 15:03 GMT\nReceived: from pepino.cs.nott.ac.uk by marian.Cs.Nott.AC.UK id aa29006;\n	6 Nov 2006 15:03 GMT\nMessage-ID: <454F4ED7.9000906@cs.nott.ac.uk>\nDate: Mon, 06 Nov 2006 15:03:51 +0000\nFrom: Roland Backhouse <rcb@Cs.Nott.AC.UK>\nOrganization: School of CS & IT, University of Nottingham\nUser-Agent: Thunderbird 1.5.0.7 (X11/20060915)\nMIME-Version: 1.0\nTo: g51mcs@Cs.Nott.AC.UK\nContent-Type: multipart/mixed; boundary="------------030100030107080306070808"\nCc: lois <lois@Cs.Nott.AC.UK>, Dipa Patel <dipa@Cs.Nott.AC.UK>\nSubject: [g51mcs] Written Examination\nX-BeenThere: g51mcs@cs.nott.ac.uk\nX-Mailman-Version: 2.1.5\nPrecedence: list\nReply-To: rcb@Cs.Nott.AC.UK\nList-Id: Module Maths for Computer Scientists <g51mcs.cs.nott.ac.uk>\nList-Unsubscribe: <http://www.cs.nott.ac.uk/mailman/listinfo/g51mcs>,\n	<mailto:g51mcs-request@cs.nott.ac.uk?subject=unsubscribe>\nList-Archive: <http://www.cs.nott.ac.uk/mailman/private/g51mcs>\nList-Post: <mailto:g51mcs@cs.nott.ac.uk>\nList-Help: <mailto:g51mcs-request@cs.nott.ac.uk?subject=help>\nList-Subscribe: <http://www.cs.nott.ac.uk/mailman/listinfo/g51mcs>,\n	<mailto:g51mcs-request@cs.nott.ac.uk?subject=subscribe>\nSender: g51mcs-bounces@Cs.Nott.AC.UK\nErrors-To: g51mcs-bounces@cs.nott.ac.uk\n\nThis is a multi-part message in MIME format.\n--------------030100030107080306070808\nContent-Type: text/plain; charset=ISO-8859-1; format=flowed\nContent-Transfer-Encoding: 7bit\n\nI am writing to inform everyone that the written examination for g51mcs \n(Mathematics for Computer Science) will be 90 minutes and not 2 hours as \nin previous years.\n\nLater in the semester, I will be talking in detail about the \nexamination.  For the time being, and because some stud