(10, 5, 'Received: from pat.cs.nott.ac.uk by robin.Cs.Nott.AC.UK id aa15337;\n          5 Oct 2006 16:07 BST\nReceived: from localhost by pat.Cs.Nott.AC.UK id ac26630; 5 Oct 2006 16:06 BST\nReceived: from marian.cs.nott.ac.uk by pat.Cs.Nott.AC.UK id aa26093;\n	5 Oct 2006 16:05 BST\nReceived: from kara.cs.nott.ac.uk by marian.Cs.Nott.AC.UK id aa22849;\n	5 Oct 2006 16:05 BST\nMessage-ID: <45251F3E.1050601@cs.nott.ac.uk>\nDate: Thu, 05 Oct 2006 16:05:34 +0100\nFrom: Lyndsay F Hargreaves <lfh@Cs.Nott.AC.UK>\nUser-Agent: Mozilla/5.0 (Windows; U; Windows NT 5.1; en-US;\n	rv:1.7.3) Gecko/20040910\nX-Accept-Language: en-us, en\nMIME-Version: 1.0\nTo: students@Cs.Nott.AC.UK\nContent-Type: multipart/mixed; boundary="------------060005080308090202050505"\nCc:  \nSubject: [students] Coursework Submssion Procedure\nX-BeenThere: students@cs.nott.ac.uk\nX-Mailman-Version: 2.1.5\nPrecedence: list\nList-Id: Student mailgroup <students.cs.nott.ac.uk>\nList-Unsubscribe: <http://www.cs.nott.ac.uk/mailman/listinfo/students>,\n	<mailto:students-request@cs.nott.ac.uk?subject=unsubscribe>\nList-Archive: <http://www.cs.nott.ac.uk/pipermail/students>\nList-Post: <mailto:students@cs.nott.ac.uk>\nList-Help: <mailto:students-request@cs.nott.ac.uk?subject=help>\nList-Subscribe: <http://www.cs.nott.ac.uk/mailman/listinfo/students>,\n	<mailto:students-request@cs.nott.ac.uk?subject=subscribe>\nSender: students-bounces@Cs.Nott.AC.UK\nErrors-To: students-bounces@cs.nott.ac.uk\n\nThis is a multi-part message in MIME format.\n--------------060005080308090202050505\nContent-Type: text/plain; charset=us-ascii; format=flowed\nContent-Transfer-Encoding: 7bit\n\nDear All,\n\nWith regards to the submission of coursework, the school has implemented \na new procedure.\n\nSubmission of coursework will no longer be through the school reception.\n\nPlease fill out a coursework cover sheet and then use the Date and Time \nstamp and the ''letter box'', located outside the staff entrance to the \nmain school office.