INSERT INTO `m_Mail` (`iMailID`, `iMaildropID`, `txMailContent`, `vchUIDL`) VALUES
(11, 2, 'Received: from pat.cs.nott.ac.uk by robin.Cs.Nott.AC.UK id aa19165;\n          19 Oct 2006 13:48 BST\nReceived: from localhost by pat.Cs.Nott.AC.UK id ab21176; 19 Oct 2006 13:48 BST\nReceived: from marian.cs.nott.ac.uk by pat.Cs.Nott.AC.UK id aa20815;\n	19 Oct 2006 13:46 BST\nReceived: from penguin.cs.nott.ac.uk by marian.Cs.Nott.AC.UK id aa03036;\n	19 Oct 2006 13:46 BST\nMessage-ID: <453773B8.1090905@cs.nott.ac.uk>\nDate: Thu, 19 Oct 2006 13:46:48 +0100\nFrom: Nick Reynolds <nir@Cs.Nott.AC.UK>\nUser-Agent: Thunderbird 1.5 (X11/20051201)\nMIME-Version: 1.0\nTo: All undergraduate and masters students <students@Cs.Nott.AC.UK>\nContent-Type: text/plain; charset=ISO-8859-1; format=flowed\nContent-Transfer-Encoding: 7bit\nCc: csit-staff@Cs.Nott.AC.UK\nSubject: [students] Disk Quota Increases\nX-BeenThere: students@cs.nott.ac.uk\nX-Mailman-Version: 2.1.5\nPrecedence: list\nList-Id: Student mailgroup <students.cs.nott.ac.uk>\nList-Unsubscribe: <http://www.cs.nott.ac.uk/mailman/listinfo/students>,\n	<mailto:students-request@cs.nott.ac.uk?subject=unsubscribe>\nList-Archive: <http://www.cs.nott.ac.uk/pipermail/students>\nList-Post: <mailto:students@cs.nott.ac.uk>\nList-Help: <mailto:students-request@cs.nott.ac.uk?subject=help>\nList-Subscribe: <http://www.cs.nott.ac.uk/mailman/listinfo/students>,\n	<mailto:students-request@cs.nott.ac.uk?subject=subscribe>\nSender: students-bounces@Cs.Nott.AC.UK\nErrors-To: students-bounces@cs.nott.ac.uk\n\nAs mentioned in some of the welcome talks, we purchased a new storage \narray in the summer to help support the increasing demands for disk \nspace used for email and student projects.\n\nNew details can be founds here:\n   http://support.cs.nott.ac.uk/services/quotas/\n\nBut a summary of the changes made this afternoon:\n  1st Year Undergrads: 20MB  -> 100MB\n  2nd Year Undergrads: 50MB -> 300MB\n  3rd Year Undergrads: 100MB -> 500MB\n  IT Masters Students: 100MB -> 500MB\n\nThese allocations reflect usage requirements for each year/course. As \nalways, disk space may be used to support your coursework only and is \nnot for storage of personal files (such as MP3''s).\n\nThanks,\nNick.\n\n-- \nNick Reynolds\nTechnical Services Group Leader\nSchool of Computer Science and Information Technology\nThe University of Nottingham\n\n_______________________________________________\nstudents mailing list\nstudents@cs.nott.ac.uk\nhttp://www.cs.nott.ac.uk/mailman/listinfo/students\n', '[:zM=''_-qN2:PTAZvW/U1L#0hvif`27t/?F_()1H}Sj6&bc{?Y'),
(12, 2, 'Received: from pat.cs.nott.ac.uk by robin.Cs.Nott.AC.UK id aa21857;\n          5 Feb 2007 7:39 GMT\nReceived: from localhost by pat.Cs.Nott.AC.UK id aa20692; 5 Feb 2007 7:38 GMT\nReceived: from smtp.nottingham.ac.uk by pat.Cs.Nott.AC.UK id aa20473;\n	5 Feb 2007 7:37 GMT\nReceived: from blaster.systems.pipex.net ([62.241.163.7])\n	by mx2.nottingham.ac.uk with esmtp (Exim 4.60)\n	(envelope-from <dge@cs.nott.ac.uk>)\n	id 1HDyPr-0005Kt-Im; Mon, 05 Feb 2007 07:37:31 +0000\nReceived: from SPIKE (81-86-46-171.dsl.pipex.com [81.86.46.171])\n	by blaster.systems.pipex.net (Postfix) with ESMTP id 14D5FE000202;\n	Mon,  5 Feb 2007 07:37:26 +0000 (GMT)\nFrom: Dave Elliman <dge@Cs.Nott.AC.UK>\nTo: rxc06u@Cs.Nott.AC.UK, g51prg@Cs.Nott.AC.UK\nMMDF-Warning: Parse error in original version of preceding line at\n	pat.Cs.Nott.AC.UK\nReferences: <200702050133.aa12089@pat.Cs.Nott.AC.UK>\nDate: Mon, 5 Feb 2007 07:37:17 -0000\nMessage-ID: <000601c748f8$76b10370$0100a8c0@SPIKE>\nMIME-Version: 1.0\nContent-Type: text/plain;\n	charset="windows-1250"\nContent-Transfer-Encoding: 7bit\nX-Mailer: Microsoft Office Outlook 11\nThread-Index: AcdIxZIVwX5SYFBfRm2NlurRf/U8OwAMhp0g\nIn-Reply-To: <200702050133.aa12089@pat.Cs.Nott.AC.UK>\nX-MimeOLE: Produced By Microsoft MimeOLE V6.00.2900.3028\nX-UoN-MailScanner-Information: Please contact\n	staff-it-helpline@nottingham.ac.uk for more information\nX-UoN-MailScanner: Found to be clean\nX-UoN-MailScanner-From: dge@cs.nott.ac.uk\nX-Spam-Status: No\nCc:  \nSubject: [g51prg] RE: comparing strings\nX-BeenThere: g51prg@cs.nott.ac.uk\nX-Mailman-Version: 2.1.5\nPrecedence: list\nList-Id: Module Introduction to Programming <g51prg.cs.nott.ac.uk>\nList-Unsubscribe: <http://www.cs.nott.ac.uk/mailman/listinfo/g51prg>,\n	<mailto:g51prg-request@cs.nott.ac.uk?subject=unsubscribe>\nList-Archive: <http://www.cs.nott.ac.uk/mailman/private/g51prg>\nList-Post: <mailto:g51prg@cs.nott.ac.uk>\nList-Help: <mailto:g51prg-request@cs.nott.ac.uk?subject=help>\nList-Subscribe: <http://www.cs.nott.ac.uk/mailman/listinfo/g51prg>,\n	<mailto:g51prg-request@cs.nott.ac.uk?subject=subscribe>\nSender: g51prg-bounces@Cs.Nott.AC.UK\nErrors-To: g51prg-bounces@cs.nott.ac.uk\n\n \nRob and all,\n\nOne of the commonest mistakes in writing Java is to compare strings with ==.\nThis compiles and runs but the comparison is on the address of the string\nnot the contents. In other words it is testing if the two strings are the\nsame one stored in the same place.  You need the .Equals(String) method to\ntest if two strings are the same.\n\nString s1 = "Fred";\nString s2 = "Fred";\n\nif(s1 == s2) {  // probably is false, but oddly enough compiler optimisation\nmight make it true by storing the two constant strings as one. But it is NOT\nwhat you want. \n    \nif(s1.Equals(s2)) {\n\nThis does the business...\n\nYour PRG lecturer\n\nDave\n\n-- \nNo virus found in this outgoing message.\nChecked by AVG Free Edition.\nVersion: 7.5.432 / Virus Database: 268.17.25/669 - Release Date: 04/02/2007\n21:58\n \n\n_______________________________________________\ng51prg mailing list\ng51prg@cs.nott.ac.uk\nhttp://www.cs.nott.ac.uk/mailman/listinfo/g51prg\n', 'mMW0uhQ|vo{d|e#lit-3nK$iDG''G@ww&Sz|g8$5q2eF<%[\\Vor');

